import React, { Component } from "react";
import { Row, Col } from "antd";

export default class Intro extends Component {
  render() {
    return (
      <Row
        type="flex"
        justify="center"
        align="middle"
        style={{ minHeight: "100vh", flexDirection:"column" }}
      >
        <Row>
          <Col>
            <h1>DL 1961</h1>
          </Col>
        </Row>
        <Row>
          <Col>
            <h1>DL 1961</h1>
          </Col>
        </Row>
      </Row>
    );
  }
}
